import React from 'react';
import Santeros from "../pages/Santeros.js";
import Texts from "../pages/Texts.js";
import {  HashRouter, useRouteMatch, Switch, Route, Link } from 'react-router-dom';

function Music() {
  const { path } = useRouteMatch();
  return (
      <div className="container">
      <h1>Music</h1>
      <nav className="menu">
          <ul>
            <li className="menu-item"><Link className="menu__link" to="/bio">Bio</Link></li>
            <li className="menu-item"><Link className="menu__link" to="/music/nosdois">Nos dois</Link></li>
            <li className="menu-item"><Link className="menu__link" to="/music/texts">Texts</Link></li>
          </ul>
      </nav>
      </div>
          );
        }

        export default Music;
